TypeScript is a JavaScript language that has been designed to provide better typescript support and enhance the developer experience.

Duck typing, on the other hand, is a programming concept that involves testing a value for a specific property rather than its type. In essence, the idea is to test the value for a certain characteristic without caring about the underlying type. This approach can be useful in situations where type information is not critical and the main concern is simply ensuring that a value meets a certain standard.

Here's an example of how both of these concepts can be used in practice:

    const string = "Hello";
    const int = 5;

    if (string === "Hello") {
        console.log("String is equal to Hello.");
    } else if (int === 5) {
        console.log("Int is equal to 5.");
    } else {
        console.log("Something else must be happening.");
    }

